import styled from "styled-components";
import HeroImage from "../../assets/hero.jpg";
export default function Home() {
  return (
    <HomeContainer>
      <SpotlightConatiner>
        <Right></Right>
        <img src={HeroImage} alt="Image" />
      </SpotlightConatiner>
    </HomeContainer>
  );
}

const HomeContainer = styled.div``;
const SpotlightConatiner = styled.div``;
